/*Data for the table `tranparencias` */

insert  into `tranparencias`(`id`,`titulo`,`texto`,`created_at`,`updated_at`,`deleted_at`) values (1,'Lei de Diretrizes Orçamentárias - LDO','<p>A Lei n&ordm; 13.473, de 08/08/2017 estabeleceu as diretrizes or&ccedil;ament&aacute;rias para o exerc&iacute;cio de 2018.</p>\n<p>Em cumprimento ao disposto no instrumento legal, o Senar divulga o seu or&ccedil;amento para o ano de 2018, sua estrutura remunerat&oacute;ria e as rela&ccedil;&otilde;es dos nomes de seus dirigentes e membros do corpo t&eacute;cnico.</p>','2021-07-10 16:56:26','2021-07-10 16:56:26',NULL),(2,'Transparência e Prestação de Contas','<p>Criado pela Lei n&ordm; 8.315, de 23/12/91, o <strong>SENAR</strong> &eacute; uma entidade de direito privado, vinculada &agrave; Confederac&atilde;o da Agricultura e Pecu&aacute;ria do Brasil - CNA e administrada por um Conselho Deliberativo tripartite, composto por representantes do governo federal e das classes trabalhadora e patronal rural.</p>\n<p>O car&aacute;ter privado, entretanto, n&atilde;o afasta a import&acirc;ncia de garantir a transpar&ecirc;ncia das a&ccedil;&otilde;es desenvolvidas com os recursos recebidos pelo <strong>SENAR</strong>&nbsp;no cumprimento de sua miss&atilde;o final&iacute;stica.</p>\n<p>Nesse sentido, o <strong>SENAR</strong> tem estabelecido um modelo de gest&atilde;o comprometida com as transpar&ecirc;ncia, a legalidade e a responsabilidade social, atenta &agrave; import&acirc;ncia de levar ao conhecimento da sociedade, de forma clara e exata, suas a&ccedil;&otilde;es e seus resultados.</p>\n<p>Com esse prop&oacute;sito, esta p&aacute;gina divulga as receitas e despesas da Administra&ccedil;&atilde;o Regional do Senar no Estado do Rio Grande do Sul, dados relevantes da sua execu&ccedil;&atilde;o or&ccedil;ament&aacute;ria, licita&ccedil;&otilde;es, contrata&ccedil;&otilde;es e gest&atilde;o de pessoal.</p>\n<p>&nbsp;</p>','2021-07-10 16:56:26','2021-07-10 16:56:26',NULL),(3,'Orçamento e Execução Orçamentária - Exercício 2017','<p>A proposta or&ccedil;ament&aacute;ria do SENAR para o exerc&iacute;cio de 2017 foi aprovada pelo Minist&eacute;rio do Trabalho e Previd&ecirc;ncia, Social atrav&eacute;s da Portaria N&ordm;&nbsp;1.468, de 30/12/2016, publicada no Di&aacute;rio Oficial da Uni&atilde;o de 02/01/2017.</p>\n<p style=\"text-align: center;\"><strong>PORTARIA N&ordm; 1.468, DE 30 DE DEZEMBRO DE 2016</strong></p>\n<p>O MINISTRO DE ESTADO DO TRABALHO, no uso de suas atribui&ccedil;&otilde;es e tendo em vista o disposto no art. 87, par&aacute;grafo &uacute;nico, inciso II, da Constitui&ccedil;&atilde;o Federal e haja vista a compet&ecirc;ncia que lhe foi atribu&iacute;da pelo art. 1&ordm; do Decreto n&ordm; 715, de 29 de dezembro de 1992, resolve:</p>\n<p>Art. 1&ordm; Aprovar, para o exerc&iacute;cio de 2017, na conformidade dos anexos I, II, III e IV, a proposta or&ccedil;ament&aacute;ria do Servi&ccedil;o Nacional de Aprendizagem Rural &ndash; SENAR.</p>\n<p>Art. 2&ordm; Determinar aos Dirigentes M&aacute;ximos da Entidade que, em respeito &agrave; orienta&ccedil;&atilde;o governamental de transpar&ecirc;ncia ativa e divulga&ccedil;&atilde;o das informa&ccedil;&otilde;es p&uacute;blicas, na linha do que disp&otilde;e Lei de Diretrizes Or&ccedil;ament&aacute;rias (LDO) aprovada para cada exerc&iacute;cio e Lei de Acesso &agrave; Informa&ccedil;&atilde;o, seja garantida a disponibiliza&ccedil;&atilde;o na rede mundial de computadores da execu&ccedil;&atilde;o or&ccedil;ament&aacute;ria ora aprovada.</p>\n<p>Art. 3&ordm; A disponibiliza&ccedil;&atilde;o das informa&ccedil;&otilde;es dever&aacute; ser apresentada, preferencialmente, por programa de trabalho em perspectiva comparativa com as metas f&iacute;sico-financeiras estimadas.</p>\n<p>Art. 4&ordm; Esta Portaria entra vigor na data de sua publica&ccedil;&atilde;o.</p>\n<p style=\"text-align: right;\"><strong>RONALDO NOGUEIRA DE OLIVEIRA</strong></p>','2021-07-10 16:56:26','2021-07-10 16:56:26',NULL),(4,'Orçamento e Execução Orçamentária - Exercícios anteriores','<p>Em cumprimento ao disposto no instrumento legal, o Senar-RS divulga o seu or&ccedil;amento para os anos de 2016, 2015 e 2014 conforme sua execu&ccedil;&atilde;o dos tr&ecirc;s &uacute;ltimos exerc&iacute;cios.</p>\n<p>&nbsp;</p>\n<p style=\"text-align: center;\">&nbsp;</p>','2021-07-10 16:56:26','2021-07-10 16:56:26',NULL),(5,'Relatório de Gestão','<p>Relat&oacute;rios de Gest&otilde;es 2013 a 2018.</p>\n<p style=\"text-align: justify;\">Visa atender &agrave;s necessidades de presta&ccedil;&atilde;o de contas anual para os org&atilde;os do controle interno e externo.&nbsp;Os conte&uacute;dos que comp&otilde;em o Relat&oacute;rio de Gest&atilde;o est&atilde;o organizados conforme informa&ccedil;&otilde;es especificadas nas Portarias do TCU - Tribunal de Contas da Uni&atilde;o e orienta&ccedil;&otilde;es do sistema de presta&ccedil;&atilde;o de contas E-Contas do TCU.</p>','2021-07-10 16:56:26','2021-07-10 16:56:26',NULL),(6,'Demonstrações Contábeis - Exercícios anteriores','','2021-07-10 16:56:26','2021-07-10 16:56:26',NULL),(7,'Gestão de Pessoal','','2021-07-10 16:56:26','2021-07-10 16:56:26',NULL),(8,'Contratos','<p>Informa&ccedil;&otilde;es sobre os Dez Maiores Contratos Celebrados no Exerc&iacute;cio.</p>','2021-07-10 16:56:27','2021-07-10 16:56:27',NULL),(9,'Orçamento e Execução Orçamentária - Exercício 2018','<p>A proposta or&ccedil;ament&aacute;ria do SENAR para o exerc&iacute;cio de 2018 foi aprovada pelo Minist&eacute;rio do Trabalho e Previd&ecirc;ncia, Social atrav&eacute;s de Portaria, publicada no Di&aacute;rio Oficial da Uni&atilde;o.</p>','2021-07-10 16:56:27','2021-07-10 16:56:27',NULL),(10,'Demonstrações Contábeis - Exercício 2018','','2021-07-10 16:56:27','2021-07-10 16:56:27',NULL),(11,'Licitações','<p><a href=\"/licitacoes\">Licita&ccedil;&otilde;es: em andamento e conclu&iacute;das</a></p>','2021-07-10 16:56:27','2021-07-10 16:56:27',NULL),(12,'Transferência de Recursos','<p>Informa&ccedil;&otilde;es Referente &agrave;s Transfer&ecirc;ncia de Recursos.</p>','2021-07-10 16:56:27','2021-07-10 16:56:27',NULL),(13,'Transparência e Prestação de Contas a partir de 2019','<p>&nbsp;<a title=\"Transpar&ecirc;ncia 2020 - Link Externo\" href=\"http://app3.cna.org.br/transparencia/#RS-2020\" target=\"_blank\" rel=\"noopener noreferrer\">Transpar&ecirc;ncia e Presta&ccedil;&atilde;o de Contas 2020 - Link Externo</a></p>\n<p>&nbsp;<a title=\"Transpar&ecirc;ncia 2019 - Link Externo\" href=\"http://app3.cna.org.br/transparencia/#RS-2019\" target=\"_blank\" rel=\"noopener noreferrer\">Transpar&ecirc;ncia e Presta&ccedil;&atilde;o de Contas 2019 - Link Externo</a></p>','2021-07-10 16:56:28','2021-07-10 16:56:28',NULL);

